import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  //Link,
  //useRouteMatch,
  // useParams,
} from "react-router-dom";
import HomePage from "./HomePage";
import LoggingPage from "./LoggingPage";

class AppСontent extends React.Component {
  render() {
    return (
      <Router>
        <div>
        <Switch>
          <Route path="./">
            <HomePage />
          </Route>
          <Route path="/login">
            <LoggingPage />
          </Route>
          <Route path="/news">
            <LoggingPage />
          </Route>
          <Route path="/profile">
            <div>
              <h1>
                Страница с произвольным текстом, недоступная без авторизации
              </h1>
            </div>
          </Route>
        </Switch>
        </div>
      </Router>
    );
  }
}

export default AppСontent;
